import "./RecordList.css";
import CalorieRecord from "./CalorieRecord";

const RecordList = (props) => {
  return (

    <ul className="record-list">
      {
      props.record.map((records) => {
        <li>
        <CalorieRecord
          date={records.date}
          meal={records.meal}
          content={records.content}
          calories={records.calories} />
          </li>

      }
    )
      }


      <li>
        <CalorieRecord
          date={props.records[1].date}
          meal={props.records[1].meal}
          content={props.records[1].content}
          calories={props.records[1].calories} /></li>
      <li>
        <CalorieRecord
          date={props.records[2].date}
          meal={props.records[2].meal}
          content={props.records[2].content}
          calories={props.records[2].calories} /></li>
      <li>
        <CalorieRecord
          date={props.records[3].date}
          meal={props.records[3].meal}
          content={props.records[3].content}
          calories={props.records[3].calories} /></li>

    </ul>


  )
}

export default RecordList
